import React from "react";
import "./Navbar.css"

function Navbar() {
    return (
        <div>
            <div className="navbar navbar-expand-lg navbar-light bg-light">
                <div className="container-fluid">
                    <a className="navbar-brand" href="/">Google Books Search Utility</a>
                </div>
            </div>
        </div>
    )
}

export default Navbar;
